import React from 'react'
import Button from '../UI/Button/Buttton'
import Aux from '../hoc/Aux'
import Canvas from '../UI/Canvas/Canvas'

const layout = (props) => {
    return(
        <Aux>
            <div>
                <Button>Pencil</Button>
                <Button>Line</Button>
                <Button>Circle</Button>
                <Button>Erase</Button>
            </div>
            <Canvas/>
        </Aux>
    );
}

export default layout;
